const ResidentInfo = ({name, imgUrl, status, episodes }) =>{

    const statusHandler = (stat) =>{
        if(stat === 'Alive'){
            return <img src="./green.svg" alt="" width={'5px'}/>
        }
    }
    return(
        <div>
            <h3>{name}</h3>
            <img src={imgUrl} alt={name}/>
            <h4>status: {status} {statusHandler(status)}</h4>
            <h5>{episodes}</h5>
        </div>
    )
}

export default ResidentInfo;
